import React,{useState,useEffect} from "react";
import axios, { Axios } from "axios";
import { useParams } from "react-router-dom";
//const id='';

function CoopSchedule()
{
    const[errorMessage,setErrorMessage]=useState("");

    const CoopSchedule = () => 
    {
        let id = useParams();
        return(id);
    };

    const get_coop_schedule = async(e) => {
        //e.preventDefault();
        const data = CoopSchedule();
        console.log(data)
        await axios.post('http://localhost:8080/student_coop_schedule',id )
            .then(res=>
            {
                console.log(res);
            })
            .catch(error => {
                setErrorMessage("No Co-op Schedule found!");
            })
    }

    get_coop_schedule();
    
    return(
        <div>
            <h1>Your Coop Schedule</h1>
            <table>
                <thead>
                    <tr>
                        <th>Weekday</th>
                        <th>Subject</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Weekday</td>
                        <td>Subject</td>
                        <td></td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}

export default CoopSchedule;
